import React from "react"
import  FileUploader from './components/FileUploader';
import Preview from "./components/Preview";
import './App.css';
import "react-toastify/dist/ReactToastify.css"
import {ToastContainer} from "react-toastify"

function App() {
  return (
    <div className="App">
      <FileUploader/>
      <Preview/>
      <ToastContainer/>
    </div>
  );
}

export default App;
